import React from 'react';
import Navbar from './Navbar.js';
import './App.css';
import Product from './ProductCard.js';
import iphone from './ressources/iphonex.png';
import logo from './logo.svg';
import nature from './ressources/nature.jpg';

export default class Menu extends React.Component{
    render(){
        return(
            <div>
                <Navbar/>,
                
                <div class="container">
                <div class="row">
                    <div class="row-md-4">
                        <div class="card text-center">
                            <img src={nature} class="card-img-top"></img>
                            <div class="card-body">
                                <h5 class="card-title">Card Title</h5>
                            </div>
                            <p class="card-text">Some quick text here</p>
                            <a href="#">CHECK GYM</a>
                        </div>
                    </div>
                    
                  
                </div>
                </div>
            </div>
            
        )
    }   
}
